import React, {Component} from "react"
import csvToJson from 'convert-csv-to-json';
import GroceryCSV from "../Data/grocery_sample.csv"


export class Item extends Component{
	constructor(props){
		super(props)
		let json = csvToJson.getJsonFromCsv("myInputFile.csv")
		console.log(json)
	}
 


	render(){
		return(
		<div>
			<h1>{this.props.supermarket_selected.name} {this.props.supermarket_selected.address}</h1>
		</div>
		)
	}
}

export default Item
